import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

import Weather from "./Weather";

import './App.css';


function App() {
  return (
    <div className="App">
      <div className="container">


      <Weather defaultCity="New York" />
      </div>

    </div>
  );
}

export default App;
